  assemblies:
  - TimeCockpit.Data
  namespace: TimeCockpit.Data.QueryLanguage.Syntax
  summary: "\nDescribes access to a member, e.g.:\nIn\n<pre><code>From X In Timesheet Where X.BeginTime &lt; #2012-10-10# Select X</code></pre>\n\"X.BeginTime\" is referred to as a MemberAccess with the segments being 'BeginTime' and alias being X.\n<remarks>\nThe alias may be null (and is by default null). An Alias of null means that the Member access refers to \nthe table source of the parenting query. \nAs of 2012-11-09, this is not possible to achieve using the grammar, as it would require not specifying an alias.\nPseudocode:\n<pre><code>From Timesheet Where BeginTime &gt; #2012-01-01# Select </code></pre>\nwould by a theoretical possibility for such a syntax.\n</remarks>\n"
  example: []
  syntax:
    content: 'public class MemberAccess : Expression'
    content.vb: >-
      Public Class MemberAccess
          Inherits Expression
